(function () {
  function contentLoaded(win, fn) {
    var done = false,
        top = true,
        doc = win.document,
        root = doc.documentElement,
        modern = doc.addEventListener,
        add = modern ? 'addEventListener' : 'attachEvent',
        rem = modern ? 'removeEventListener' : 'detachEvent',
        pre = modern ? '' : 'on',
        init = function (e) {
      if (e.type == 'readystatechange' && doc.readyState != 'complete') return;
      (e.type == 'load' ? win : doc)[rem](pre + e.type, init, false);
      if (!done && (done = true)) fn.call(); //win, e.type || e
    },
        poll = function () {
      try {
        root.doScroll('left');
      } catch (e) {
        setTimeout(poll, 50);
        return;
      }

      init('poll');
    };

    if (doc.readyState == 'complete') fn.call(); //win, 'lazy'
    else {
        if (!modern && root.doScroll) {
          try {
            top = !win.frameElement;
          } catch (e) {}

          if (top) poll();
        }

        doc[add](pre + 'DOMContentLoaded', init, false);
        doc[add](pre + 'readystatechange', init, false);
        win[add](pre + 'load', init, false);
      }
  }

  function replaceHtmlLan(res) {
    res = res || lanRes;

    if (typeof UTIL !== "undefined") {
      UTIL.prototype.serverAdaptor.fuzzyBrandI18nRes(res);
    }

    var body = document.body || document.getElementsByTagName('body')[0];
    translater(body);

    function translater(node) {
      if (!node || !node.getAttribute) return;
      var attr = node.getAttribute('langs');

      if (attr && res[attr]) {
        if (res[attr].constructor == String) {
          node.innerHTML = res[attr];
        } else {
          //处理可能的需要的多语言标签属性
          for (var e in res[attr]) {
            if (res[attr][e] && node.getAttribute(e)) {
              node.setAttribute(e, res[attr][e]);
            }
          }
        }
      }

      var children = node.childNodes;

      for (var i = 0; i < children.length; i++) {
        translater(children[i]);
      }
    }
  }

  contentLoaded(window, replaceHtmlLan);

  window.replaceLanRes = function (res) {
    if (!res || !EChatQuery || typeof res != 'object') {
      //ws返回资源和console的调用资源的时候 页面都应该加载好了
      return;
    }

    replaceHtmlLan(res);
    lanRes = EChatQuery.extend(lanRes, res);
  };
})();